;;; ## Evolutions
;; **

;; @@
(defn plot-dg-evolution [coll]
(let [curr (center-degree coll t0 tmax :evolution)
       dat {:count (map :mean curr)
            :days (range (count curr))}]
    (gg4clj/view
      [[:<- :d (gg4clj/data-frame dat)]
       (gg4clj/r+
         [:ggplot :d [:aes :days :count]]
         [:geom_line {:color "steelblue"}]
         [:xlab "Day"]
         [:ylab "Degree"]
         [:theme_bw]
         [:ggtitle (str "Average degree evolution of " (element-name coll))])]
      {:width 5 :height 5})))
